function Footer(){

    return(
        <footer className="footer">
            <Container className="border-top justify-content-between" fluid={true}>
                   <span className="footer-span">Copyright &copy; Gaofeng. All rights reserved.</span>
                   <p><br></br></p>
                   <a href="https://www.linkedin.com/in/gaofengyin/" target="_blank" rel="noopener noreferrer">
                <img className="link" src={link} alt="img" /></a>
            </Container>
        </footer>
    );

}

export default Footer;
